import addData from "./dbCon";
import Layout from "../components/layout";

function adddData (data){
    addData(data);
};

const Mock = () => (
  <Layout>
    <h1 style={{ color: "white" }}>Deneme</h1>
    <input type="text" placeholder="Type something..." id="input" />
    <button
      id="submit"
      onClick={adddData(document.getElementById("input").value)}
    >
      Submit
    </button>
    <p style={{ color: "red" }} hidden>Blank input!</p>
    {adddData("ahmet")}
  </Layout>
);

export default Mock;
